result:
.mainI {
    .card {
        width: 100%;
    }
    .remove-padding {
        padding: 0 4px;
    }
    strong, small {
        margin-left: 10px;
    }
    .card-hover {
        cursor: pointer;
    }
    .user-name {
        color: #20a8d8;
        cursor: pointer;
    }
    .table-outline td {
        height: 40px;
    }
    .table {
        th {
            color: #73818f;
        }
    }
    .week-drop {
        button {
            color: #73818f;
            background-color: transparent;
            background-image: none;
            border-color: #73818f;
        }
    }
    .pie-group {
        #battery-health > div, #inventory-location > div{
            margin: 0 auto;
        }
        h4 {
            text-align: center;
            color: #73818f;
        }
    }
}
